import { Outlet, Link } from "react-router";

const Layout = () => {
    return (
      <>
        <nav>
          <ul>
            <li>
              <Link to="/">Initial</Link>
            </li>
          </ul>
        </nav>
        <Outlet />
      </>
    )
  };

export default Layout;
